import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header"> YUMMY GED</header>
      <main>
        <section>
          <h1>Science Lessons</h1>
        </section>
        <section>Social Studies Lessons</section>
        <section>Language Arts Lessons</section>
        <section>Math Lessons</section>
      </main>
    </div>
  );
}

export default App;
